export default function Todo(props) {
    return (
        <li className="todo-item"> 
            <div className="todo-outer-circle" >
                <input id={props.id} type="checkbox" className={props.completed ? "todo-circle-ticked" : "todo-inner-circle"} />

            </div>
            <label className="todo-label" htmlFor={props.id}>
    {props.name}
  </label>
            <div style={{ textDecoration: props.completed ? "line-through" : "" }} className="todo-text">
                {props.name}
            </div>
            <button type="button" className="todo-delete"><span className="visually-hidden">{props.name}</span></button>
        </li>      
    );
}
